import React from 'react';

const AuthInput = () => {
    return (
        <div className="auth-form">
            <div>
                <label>Email:</label>
                <input name="login" />
            </div>
            <div>
                <label>Пароль:</label>
                <input name="password" />
            </div>
        </div>
    )
}

export default AuthInput;
